      SELECT DISTINCT col2 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( + col2 * + 29 * + CAST ( NULL AS INTEGER ) / 20 * - 36 NOT BETWEEN NULL AND - - 25 + - col2 + - 41 / 13 );
  - name: tab1

outputs:
  - name: q9463.out
    data: |
